-- ----------------------------
-- Triggers structure for table walk_in
-- ----------------------------
DROP TRIGGER IF EXISTS `before_walk_in_insert`;
delimiter ;;
CREATE TRIGGER `before_walk_in_insert` BEFORE INSERT ON `walk_in` FOR EACH ROW BEGIN
    IF NEW.appointment_number IS NULL THEN
        SET NEW.appointment_number = CONCAT(
            LPAD((SELECT COUNT(*) FROM walk_in) + 1, 4, '0'));
    END IF;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
